import React from 'react';
import Question from "./Question"

export default function Main(props){
    const [questions, setQuestions] = ("")

    React.useEffect( () => function fetchQuestions(){
        let question = fetch("https://opentdb.com/api.php?amount=5&type=multiple").then(res => res.json())
            .then(data => console.log(data))

        setQuestions(question)
    },[props.firstPage])

    const questionElements = questions.localeCompare(question =>
        <Question question={questions.question} correctAnswer={question.correct_answer} wrongAnswers={question.incorrect_answers} />
    )
    return(
        <div>
            {questionElements}
        </div>
    )
}
